--
-- Table structure for table `posts`
--

DROP TABLE IF EXISTS `posts`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `posts` (
  `id` int unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `source_id` int unsigned NOT NULL COMMENT 'ссылка на создателя поста (пользователь или группа)',
  `source_type` tinyint unsigned NOT NULL COMMENT 'тип создателя поста',
  `content` text CHARACTER SET utf8 COLLATE utf8_unicode_ci COMMENT 'контент постаста',
  `media_id` int unsigned DEFAULT NULL COMMENT 'ссылка на медиа контент',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='посты';
